def test_login_face_success(client, mocker):
    mock_collection = mocker.patch('db.mongo.get_users_collection')
    mock_collection.return_value.find.return_value = [{
        "username": "testuser",
        "profile_picture": "data:image/jpeg;base64,"
    }]

    mocker.patch('deepface.DeepFace.verify', return_value={"verified": True})

    fake_image = "data:image/jpeg;base64,"
    response = client.post('/api/login_face', json={"image": fake_image})

    assert response.status_code == 200
    data = response.get_json()
    assert data['message'] == "Face recognized successfully!"
    assert "username" in data